import React from 'react'
import ReactDOM from 'react-dom'
import './react-contact-card.css'

function ContactCard(props)
{
    return(
        <div id="contact-card">
            <h1 class="contact-content">{props.phone}</h1>
            <h1 class="contact-content">{props.email}</h1>
            <div id="social-media-wrapper">
                <a href={props.facebook}>Facebook</a>
                <a href={props.instagram}>Instagram</a>
                <a href={props.youtube}>YouTube</a>
            </div>
        </div>
    )
}

export default {ContactCard}
